import styled from "styled-components";
export const PolicyItems = styled.div`
  display: flex;
  padding: 1rem .75rem;
  .icon-policy {
    padding-right: 2rem;
    font-size: 3.1rem;
  }
  .info {
    width: 80%;
    display: flex;
    flex-wrap: wrap;
  }
`;
